			comboBoxContainer.addChild(forcombo); //הוספה של הקומבו בוקס לקונטיינר
			stage.addChild(comboBoxContainer); //הצגה של האלמנטים בקונטיינר על הבמה
			forcombo.startbtn.alpha = 0.3; //שקיפות של כפתור בחר
