		//פונקציה השמקבלת משתנה בחירה בקומבו בוקס ומנתבת בהתאם
		function mycb_change(evt) {
			//שמירת הערך שנבחר בקומבו
			comboBoxContainer.getChildByName("combo");
			mychoice = evt.currentTarget.value;
			//אם נבחר הערך הראשון - "בחר נושא
			if (mychoice == 0) {
				//ניטרול כפתור "בחר
				comboBoxContainer.getChildByName("combo").startbtn.alpha = 0.3;
				comboBoxContainer.getChildByName("combo").startbtn.removeEventListener("click", fl_ClickToPosition);
			} else {
				//בכל בחירה אחרת - כלומר בחר נושא תקין, נאפשר לחיצה
				comboBoxContainer.getChildByName("combo").startbtn.alpha = 1;
				comboBoxContainer.getChildByName("combo").startbtn.addEventListener("click", fl_ClickToPosition);
			}
		}
		
		
		
